function Project(props) {
	return (
		<div className="project-container">
			<img className="project-image" src={props.img} alt={props.imgalt} />
			<h2>{props.name}</h2>
			<p>{props.info}</p>
			<a href={props.url}>Site</a>
			<a href={props.repo}>Repo</a>
		</div>
	);
}

export default Project;
